export class AccountInfo {
    isSignedIn: boolean = false;
    uuid: number = -1;
    id: string = '';
    nick: string = '';
    email: string = '';

    constructor(inObj: Record<string, unknown>) {
        if (!inObj.uuid) return;

        this.isSignedIn = true;

        this.uuid = inObj.uuid;
        this.id = inObj.id;
        this.nick = inObj.nick;
        this.email = inObj.email;
    }
}
